# @lc app=leetcode.cn id=1765 lang=python3
#
# [1765] 地图中的最高点
#
from sbw import *
# @lc code=start
class Solution:
    def highestPeak(self, isWater: List[List[int]]) -> List[List[int]]:
        R,C=len(isWater),len(isWater[0])
        height=[[-1]*C for _ in range(R)]
        q=deque()
        for r in range(R):
            for c in range(C):
                if isWater[r][c]:
                    q.append([r,c])
                    height[r][c]=0
        dirs=[-1,0,1,0,-1]
        while q:
            r,c=q.popleft()
            for i in range(4):
                nr,nc=r+dirs[i],c+dirs[i+1]
                if nr<0 or nr==R or nc<0 or nc==C or height[nr][nc]!=-1:
                    continue
                height[nr][nc]=height[r][c]+1
                q.append([nr,nc])
        return height
        
# @lc code=end
